import React from 'react'; // Import the Component component from React
import {Link} from 'react-router-dom'; // Import the Link component
import '../css/App.css';
import HomepageProject from './homepageProject.js'

const panaseer = {
  'image':require("./../content/projects/panaseer/9.png")
}

const joyStory = {
  'image':require("./../content/projects/joyStory/thumbnail.png")
}

const beatbox = {
  'image':require("./../content/projects/beatbox/teaser.mp4")
}

const project_total = "03"

function Home(props) {
  return (
    <div>
      <HomepageProject
       projectKey={'panaseer'}
       image={panaseer.image}
       number="01"
       total={project_total}
      />
      <HomepageProject
       projectKey={'joyStory'}
       image={joyStory.image}
       number="02"
       total={project_total}
      />


    </div>
  );
}

export default Home;
